import React from 'react';
import { Link } from 'react-router-dom';
import { ShoppingCart } from 'phosphor-react';

 export const Navbar = () => {
  return (
    <div className= "navbar">
       <div className= "links">
          <Link to ="/">Shopping Cart </Link>
          <Link to ="/ cart"><ShoppingCart size ={44}/></Link>
    </div>
    
    </div>
  )
}
